import { useSelector } from "react-redux";
import store from "../store/store";
import { fetchQUEST } from "../actions/fetchQuests"

store.dispatch(fetchQUEST());

export const Quests = () => {
  const state = useSelector(state => state.quest);
  const quests = state;

  return (
    <ul>
        {quests}
    </ul>
  );
}

export default Quests;
